import pic from './logo.svg';
import { CartContext } from './CartContext';
import { useContext ,useEffect, useState } from 'react'
function Cart() {
   const {cart}= useContext(CartContext)
   const {products, setProduct}= useState([]);
   useEffect(()=>{
       fetch('/api/',{
           params: Object.keys(cart.items)
       })
       .then((res)=>{res.json()})
       .then((data)=>{
           console.log(data);
           setProduct(data);
       })
   },[]);
    return ( 
       <table className="table table-success table-striped">
           <tr>
               <th>Image</th>
               <th>Product Name</th>
               <th>Quantity</th>
               <th>Price</th>
           </tr>
           {products.map((result)=>(

           <tr key={result._id}>
               <td><img src={pic}  alt=''/></td>
               <td></td>
               
            </tr>
           ))}
       </table>
     );
}

export default Cart;
